2 - Model Definition
The file type used to represent metabolic networks as GEMs is the Systems Biology Markup Language (SBML). To put it simply, these are XML files with specific notation and rules that allow the grouping and connection between genes, reactions, metabolites and their respective units. There are a large number of conventions and versions constantly being released to constantly make these models more updated and comprehensive. To see the specifications for each version see here.
Below is the example of a model for the central carbon metabolism of E. coli. It is faily small in size and is the most widely used model for educational purposes.


